import {useParams} from 'react-router-dom'
import {useEffect} from 'react'
import {orderOffersConclusionsMount} from '../../Models/order-model'

const initialParams = {
    limit: 10,
    offset: 0
}

export function useOrderOfferIdConclusions() {
    const {offer_id} = useParams()

    useEffect(() => {
        if (offer_id) {
            orderOffersConclusionsMount(offer_id)
        }
    }, [offer_id])
}
